import React, { Component } from 'react';
import logo from '../../assets/logo.gif'
import './Header.css';

class Header extends Component{
    render(){
        return(
            <div className="nav">
                <img src={logo} alt='logo'></img>
            </div>
        )
    }
}

export default Header
